import React from 'react';
import "./App.css";
import Home from "./Home";
import Rooms from "./Rooms";
import SingleRooms from "./SingleRooms";
import Errors from "./Errors";


function App() {
  return (
    <div>

      <Home></Home>
      <Rooms></Rooms>
      <Errors></Errors>
      <SingleRooms></SingleRooms>
    </div>


  );
} 

export default App;
